import { useState } from "react";

function Id() {
  const [userId,setUserId] = useState('');
  const getUserId = (e) => {
    setUserId(e.target.value);
  }

    return (
        <div className="form-group">
            <label htmlFor="userId">사용자 아이디</label>
            <input
              type="text"
              id="userId"
              name="userId"
              value={userId}
              onChange={getUserId}
              required
            />
          </div>
    );
}

export default Id;
